export const initialState = {
    mainPosts: [{
        id: 1,
        User: {
            id: 'lah1203',
            nickname: '아현',
        },
        content: '첫 번째 게시글 #해시태그 #익스프레스',
        Images: [{
            src: 'data:image/png;base64,'
        }, {
            src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQe6Fj5NtHvFowdHwYG4tgCEm0mA1VlZwHXkA&usqp=CAU'
        }, {
            src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1vu3k01uJWS0MUDHPcMmS0YOrGvharYfAWA&usqp=CAU'
        }],
        Comments: [{
            User: {
                nickname: 'Aha',
            },
            content: '짱구 너무 귀여워!',
        }, {
            User: {
                nickname: 'zero',
            },
            content: 'ㅇㅈ',
        }]
    }],
    imagePaths: [],
    postAdded: false,
};

const ADD_POST = 'ADD_POST';
export const addPost = {
    type: ADD_POST,
};
const dummyPost = {
    id: 2,
    content: '더미데이터',
    User: {
        id: 1,
        nickname: 'Aha',
    },
    Images: [],
    Comments: [],
}

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case ADD_POST:
            return {
                ...state,
                mainPosts: [dummyPost, ...state.mainPosts],
                postAdded: true,
            };
        default:
            return state;
    }
};

export default reducer;
